import Body from './components/body/Body'
import Header from './components/header/Header';

function App() {
  const dispatch = useDispatch()
  const token = useSelector(state => state.token)

  return (
    <Router>
      <div className='App'>
        <Banner/>
        <Header/>
        <Body/>
      </div>
    </Router>
  );
}

export default App;
